//assets22.pokemon.com/assets/cms2/img/pokedex/full/036.png",types:["fairy"],evolutions:[]},{_id:"557a72ae7276d341b41ede2d",pkdx_id:37,national_id:37,name:"Vulpix",__v:3,image_url:"http://pokeapi.co/media/img/37.png",description:"Inside Vulpix's body burns a flame that never goes out. During the daytime, when the temperatures rise, this Pok\xe9mon releases flames from its mouth to prevent its body from growing too hot.  At the time of its birth, Vulpix has one white tail. The tail separates into six if this Pok\xe9mon receives plenty of love from its Trainer. The six tails become magnificently curled.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/037.png",types:["fire"],evolutions:[{method:"stone",to:"Ninetales",_id:"557a72ae7276d341b41ede2e"}]},{_id:"557a72ab7276d341b41eddc3",pkdx_id:38,national_id:38,name:"Ninetales",__v:3,image_url:"http://pokeapi.co/media/img/38.png",description:"Legend has it that Ninetales came into being when nine wizards possessing sacred powers merged into one. This Pok\xe9mon is highly intelligent\u2014it can understand human speech.  Ninetales casts a sinister light from its bright red eyes to gain total control over its foe's mind. This Pok\xe9mon is said to live for a thousand years.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/038.png",types:["fire"],evolutions:[]},{_id:"557a72b07276d341b41ede4b",pkdx_id:39,national_id:39,name:"Jigglypuff",__v:4,image_url:"http://pokeapi.co/media/img/39.png",description:"When this Pok\xe9mon sings, it never pauses to breathe. If it is in a battle against an opponent that does not easily fall asleep, Jigglypuff cannot breathe, endangering its life.  Jigglypuff's vocal cords can freely adjust the wavelength of its voice. This Pok\xe9mon uses this ability to sing at precisely the right wavelength to make its foes most drowsy.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/039.png",types:["normal","fairy"],evolutions:[{method:"stone",to:"Wigglytuff",_id:"557a72b07276d341b41ede4c"}]},{_id:"557a72ac7276d341b41eddf6",pkdx_id:40,national_id:40,name:"Wigglytuff",__v:4,image_url:"http://pokeapi.co/media/img/40.png",description:"Wigglytuff's body is very flexible. By inhaling deeply, this Pok\xe9mon can inflate itself seemingly without end. Once inflated, Wigglytuff bounces along lightly like a balloon.  Wigglytuff has large, saucerlike eyes. The surfaces of its eyes are always covered with a thin layer of tears. If any dust gets in this Pok\xe9mon's eyes, it is quickly washed away.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/040.png",types:["normal","fairy"],evolutions:[]},{_id:"557a72b27276d341b41ede82",pkdx_id:41,national_id:41,name:"Zubat",__v:4,image_url:"http://pokeapi.co/media/img/41.png",description:"Zubat avoids sunlight because exposure causes it to become unhealthy. During the daytime, it stays in caves or under the eaves of old houses, sleeping while hanging upside down.  Zubat remains quietly unmoving in a dark spot during the bright daylight hours. It does so because prolonged exposure to the sun causes its body to become slightly burned.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/041.png",types:["flying","poison"],evolutions:[{level:22,method:"level_up",to:"Golbat",_id:"557a72b27276d341b41ede83"}]},{_id:"557a72ae7276d341b41ede28",pkdx_id:42,national_id:42,name:"Golbat",__v:5,image_url:"http://pokeapi.co/media/img/42.png",description:"Golbat bites down on prey with its four fangs and drinks the victim's blood. It becomes active on inky dark moonless nights, flying around to attack people and Pok\xe9mon.  Golbat loves to drink the blood of living things. It is particularly active in the pitch black of night. This Pok\xe9mon flits around in the night skies, seeking fresh blood.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/042.png",types:["flying","poison"],evolutions:[{method:"other",to:"Crobat",_id:"557a72ae7276d341b41ede29"}]},{_id:"557a72ad7276d341b41ede16",pkdx_id:43,national_id:43,name:"Oddish",__v:5,image_url:"http://pokeapi.co/media/img/43.png",description:"Oddish searches for fertile, nutrient-rich soil, then plants itself. During the daytime, while it is planted, this Pok\xe9mon's feet are thought to change shape and become similar to the roots of trees.  During the daytime, Oddish buries itself in soil to absorb nutrients from the ground using its entire body. The more fertile the soil, the glossier its leaves become.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/043.png",types:["poison","grass"],evolutions:[{level:21,method:"level_up",to:"Gloom",_id:"557a72ad7276d341b41ede17"}]},{_id:"557a72ac7276d341b41edddf",pkdx_id:44,national_id:44,name:"Gloom",__v:4,image_url:"http://pokeapi.co/media/img/44.png",description:"From its mouth Gloom drips honey that smells absolutely horrible. Apparently, it loves the horrid stench. It sniffs the noxious fumes and then drools even more of its honey.  Gloom releases a foul fragrance from the pistil of its flower. When faced with danger, the stench worsens. If this Pok\xe9mon is feeling calm and secure, it does not release its usual stinky aroma.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/044.png",types:["poison","grass"],evolutions:[{method:"stone",to:"Bellossom",_id:"557a72ac7276d341b41edde1"},{method:"stone",to:"Vileplume",_id:"557a72ac7276d341b41edde0"}]},{_id:"557a72ad7276d341b41ede02",pkdx_id:45,national_id:45,name:"Vileplume",__v:4,image_url:"http://pokeapi.co/media/img/45.png",description:"Vileplume has the world's largest petals. They are used to attract prey that are then doused with toxic spores. Once the prey are immobilized, this Pok\xe9mon catches and devours them.  Vileplume's toxic pollen triggers atrocious allergy attacks. That's why it is advisable never to approach any attractive flowers in a jungle, however pretty they may be.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/045.png",types:["poison","grass"],evolutions:[]},{_id:"557a72ae7276d341b41ede23",pkdx_id:46,national_id:46,name:"Paras",__v:4,image_url:"http://pokeapi.co/media/img/46.png",description:"Paras has parasitic mushrooms growing on its back called tochukaso. They grow large by drawing nutrients from this Bug Pok\xe9mon host. They are highly valued as a medicine for extending life.  Paras has parasitic mushrooms growing on its back called tochukaso. They grow large by drawing nutrients from this Bug Pok\xe9mon host. They are highly valued as a medicine for extending life.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/046.png",types:["bug","grass"],evolutions:[{level:24,method:"level_up",to:"Parasect",_id:"557a72ae7276d341b41ede24"}]},{_id:"557a72af7276d341b41ede44",pkdx_id:47,national_id:47,name:"Parasect",__v:5,image_url:"http://pokeapi.co/media/img/47.png",description:"Parasect is known to infest large trees en masse and drain nutrients from the lower trunk and roots. When an infested tree dies, they move onto another tree all at once.  Parasect is known to infest large trees en masse and drain nutrients from the lower trunk and roots. When an infested tree dies, they move onto another tree all at once.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/047.png",types:["bug","grass"],evolutions:[]},{_id:"557a72ad7276d341b41ede06",pkdx_id:48,national_id:48,name:"Venonat",__v:5,image_url:"http://pokeapi.co/media/img/48.png",description:"Venonat is said to have evolved with a coat of thin, stiff hair that covers its entire body for protection. It possesses large eyes that never fail to spot even minuscule prey.  Venonat is said to have evolved with a coat of thin, stiff hair that covers its entire body for protection. It possesses large eyes that never fail to spot even minuscule prey.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/048.png",types:["poison","bug"],evolutions:[{level:31,method:"level_up",to:"Venomoth",_id:"557a72ad7276d341b41ede07"}]},{_id:"557a72b07276d341b41ede5b",pkdx_id:49,national_id:49,name:"Venomoth",__v:4,image_url:"http://pokeapi.co/media/img/49.png",description:"Venomoth is nocturnal\u2014it is a Pok\xe9mon that only becomes active at night. Its favorite prey are small insects that gather around streetlights, attracted by the light in the darkness.  Venomoth is nocturnal\u2014it is a Pok\xe9mon that only becomes active at night. Its favorite prey are small insects that gather around streetlights, attracted by the light in the darkness.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/049.png",types:["poison","bug"],evolutions:[]},{_id:"557a72ad7276d341b41ede0e",pkdx_id:50,national_id:50,name:"Diglett",__v:3,image_url:"http://pokeapi.co/media/img/50.png",description:"Diglett are raised in most farms. The reason is simple\u2014 wherever this Pok\xe9mon burrows, the soil is left perfectly tilled for planting crops. This soil is made ideal for growing delicious vegetables.  Diglett are raised in most farms. The reason is simple\u2014 wherever this Pok\xe9mon burrows, the soil is left perfectly tilled for planting crops. This soil is made ideal for growing delicious vegetables.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/050.png",types:["ground"],evolutions:[{level:26,method:"level_up",to:"Dugtrio",_id:"557a72ad7276d341b41ede0f"}]},{_id:"557a72af7276d341b41ede48",pkdx_id:51,national_id:51,name:"Dugtrio",__v:3,image_url:"http://pokeapi.co/media/img/51.png",description:"Dugtrio are actually triplets that emerged from one body. As a result, each triplet thinks exactly like the other two triplets. They work cooperatively to burrow endlessly.  Dugtrio are actually triplets that emerged from one body. As a result, each triplet thinks exactly like the other two triplets. They work cooperatively to burrow endlessly.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/051.png",types:["ground"],evolutions:[]},{_id:"557a72ae7276d341b41ede31",pkdx_id:52,national_id:52,name:"Meowth",__v:3,image_url:"http://pokeapi.co/media/img/52.png",description:"Meowth withdraws its sharp claws into its paws to slinkily sneak about without making any incriminating footsteps. For some reason, this Pok\xe9mon loves shiny coins that glitter with light.  Meowth withdraws its sharp claws into its paws to slinkily sneak about without making any incriminating footsteps. For some reason, this Pok\xe9mon loves shiny coins that glitter with light.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/052.png",types:["normal"],evolutions:[{level:28,method:"level_up",to:"Persian",_id:"557a72ae7276d341b41ede32"}]},{_id:"557a72b07276d341b41ede5f",pkdx_id:53,national_id:53,name:"Persian",__v:3,image_url:"http://pokeapi.co/media/img/53.png",description:"Persian has six bold whiskers that give it a look of toughness. The whiskers sense air movements to determine what is in the Pok\xe9mon's surrounding vicinity. It becomes docile if grabbed by the whiskers.  Persian has six bold whiskers that give it a look of toughness. The whiskers sense air movements to determine what is in the Pok\xe9mon's surrounding vicinity. It becomes docile if grabbed by the whiskers.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/053.png",types:["normal"],evolutions:[]},{_id:"557a72b07276d341b41ede57",pkdx_id:54,national_id:54,name:"Psyduck",__v:5,image_url:"http://pokeapi.co/media/img/54.png",description:"If it uses its mysterious power, Psyduck can't remember having done so. It apparently can't form a memory of such an event because it goes into an altered state that is much like deep sleep.  Psyduck uses a mysterious power. When it does so, this Pok\xe9mon generates brain waves that are supposedly only seen in sleepers. This discovery spurred controversy among scholars.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/054.png",types:["water"],evolutions:[{level:33,method:"level_up",to:"Golduck",_id:"557a72b07276d341b41ede58"}]},{_id:"557a72ad7276d341b41ede0b",pkdx_id:55,national_id:55,name:"Golduck",__v:3,image_url:"http://pokeapi.co/media/img/55.png",description:"Golduck is the fastest swimmer among all Pok\xe9mon. It swims effortlessly, even in a rough, stormy sea. It sometimes rescues people from wrecked ships floundering in high seas.  The webbed flippers on its forelegs and hind legs and the streamlined body of Golduck give it frightening speed. This Pok\xe9mon is definitely much faster than even the most athletic swimmer.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/055.png",types:["water"],evolutions:[]},{_id:"557a72d17276d341b41ee20a",pkdx_id:56,national_id:56,name:"Mankey",__v:3,image_url:"http://pokeapi.co/media/img/56.png",description:"When Mankey starts shaking and its nasal breathing turns rough, it's a sure sign that it is becoming angry. However, because it goes into a towering rage almost instantly, it is impossible for anyone to flee its wrath.  When Mankey starts shaking and its nasal breathing turns rough, it's a sure sign that it is becoming angry. However, because it goes into a towering rage almost instantly, it is impossible for anyone to flee its wrath.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/056.png",types:["fighting"],evolutions:[{level:28,method:"level_up",to:"Primeape",_id:"557a72d17276d341b41ee20b"}]},{_id:"557a72af7276d341b41ede3d",pkdx_id:57,national_id:57,name:"Primeape",__v:3,image_url:"http://pokeapi.co/media/img/57.png",description:"When Primeape becomes furious, its blood circulation is boosted. In turn, its muscles are made even stronger. However, it also becomes much less intelligent at the same time.  When Primeape becomes furious, its blood circulation is boosted. In turn, its muscles are made even stronger. However, it also becomes much less intelligent at the same time.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/057.png",types:["fighting"],evolutions:[]},{_id:"557a72ae7276d341b41ede1b",pkdx_id:58,national_id:58,name:"Growlithe",__v:3,image_url:"http://pokeapi.co/media/img/58.png",description:"Growlithe has a superb sense of smell. Once it smells anything, this Pok\xe9mon won't forget the scent, no matter what. It uses its advanced olfactory sense to determine the emotions of other living things.  Growlithe has a superb sense of smell. Once it smells anything, this Pok\xe9mon won't forget the scent, no matter what. It uses its advanced olfactory sense to determine the emotions of other living things.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/058.png",types:["fire"],evolutions:[{method:"stone",to:"Arcanine",_id:"557a72ae7276d341b41ede1c"}]},{_id:"557a72af7276d341b41ede3a",pkdx_id:59,national_id:59,name:"Arcanine",__v:3,image_url:"http://pokeapi.co/media/img/59.png",description:"Arcanine is known for its high speed. It is said to be capable of running over 6,200 miles in a single day and night. The fire that blazes wildly within this Pok\xe9mon's body is its source of power.  Arcanine is known for its high speed. It is said to be capable of running over 6,200 miles in a single day and night. The fire that blazes wildly within this Pok\xe9mon's body is its source of power.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/059.png",types:["fire"],evolutions:[]},{_id:"557a72ae7276d341b41ede1f",pkdx_id:60,national_id:60,name:"Poliwag",__v:3,image_url:"http://pokeapi.co/media/img/60.png",description:"Poliwag has a very thin skin. It is possible to see the Pok\xe9mon's spiral innards right through the skin. Despite its thinness, however, the skin is also very flexible. Even sharp fangs bounce right off it.  Poliwag has a very thin skin. It is possible to see the Pok\xe9mon's spiral innards right through the skin. Despite its thinness, however, the skin is also very flexible. Even sharp fangs bounce right off it.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/060.png",types:["water"],evolutions:[{level:25,method:"level_up",to:"Poliwhirl",_id:"557a72ae7276d341b41ede20"}]},{_id:"557a72af7276d341b41ede35",pkdx_id:61,national_id:61,name:"Poliwhirl",__v:3,image_url:"http://pokeapi.co/media/img/61.png",description:"The surface of Poliwhirl's body is always wet and slick with a slimy fluid. Because of this slippery covering, it can easily slip and slide out of the clutches of any enemy in battle.  The surface of Poliwhirl's body is always wet and slick with a slimy fluid. Because of this slippery covering, it can easily slip and slide out of the clutches of any enemy in battle.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/061.png",types:["water"],evolutions:[{method:"trade",to:"Politoed",_id:"557a72af7276d341b41ede37"},{method:"stone",to:"Poliwrath",_id:"557a72af7276d341b41ede36"}]},{_id:"557a72d17276d341b41ee201",pkdx_id:62,national_id:62,name:"Poliwrath",__v:4,image_url:"http://pokeapi.co/media/img/62.png",description:"Poliwrath's highly developed, brawny muscles never grow fatigued, however much it exercises. It is so tirelessly strong, this Pok\xe9mon can swim back and forth across the ocean without effort.  Poliwrath's highly developed, brawny muscles never grow fatigued, however much it exercises. It is so tirelessly strong, this Pok\xe9mon can swim back and forth across the ocean without effort.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/062.png",types:["fighting","water"],evolutions:[]},{_id:"557a72d17276d341b41ee212",pkdx_id:63,national_id:63,name:"Abra",__v:3,image_url:"http://pokeapi.co/media/img/63.png",description:"Abra needs to sleep for eighteen hours a day. If it doesn't, this Pok\xe9mon loses its ability to use telekinetic powers. If it is attacked, Abra escapes using Teleport while it is still sleeping.  Abra sleeps for eighteen hours a day. However, it can sense the presence of foes even while it is sleeping. In such a situation, this Pok\xe9mon immediately teleports to safety.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/063.png",types:["psychic"],evolutions:[{level:16,method:"level_up",to:"Kadabra",_id:"557a72d17276d341b41ee213"}]},{_id:"557a72cf7276d341b41ee1bf",pkdx_id:64,national_id:64,name:"Kadabra",__v:3,image_url:"http://pokeapi.co/media/img/64.png",description:"Kadabra holds a silver spoon in its hand. The spoon is used to amplify the alpha waves in its brain. Without the spoon, the Pok\xe9mon is said to be limited to half the usual amount of its telekinetic powers.  Kadabra emits a peculiar alpha wave if it develops a headache. Only those people with a particularly strong psyche can hope to become a Trainer of this Pok\xe9mon.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/064.png",types:["psychic"],evolutions:[{method:"trade",to:"Alakazam",_id:"557a72cf7276d341b41ee1c0"}]},{_id:"557a72d07276d341b41ee1de",pkdx_id:65,national_id:65,name:"Alakazam",__v:3,image_url:"http://pokeapi.co/media/img/65.png",description:"Alakazam's brain continually grows, infinitely multiplying brain cells. This amazing brain gives this Pok\xe9mon an astoundingly high IQ of 5,000. It has a thorough memory of everything that has occurred in the world.  Alakazam's brain continually grows, making its head far too heavy to support with its neck. This Pok\xe9mon holds its head up using its psychokinetic power instead.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/065.png",types:["psychic"],evolutions:[{method:"other",to:"Alakazam-mega",_id:"557a72d07276d341b41ee1df"}]},{_id:"557a72d07276d341b41ee1f9",pkdx_id:66,national_id:66,name:"Machop",__v:3,image_url:"http://pokeapi.co/media/img/66.png",description:"Machop exercises by hefting around a Graveler as if it were a barbell. There are some Machop that travel the world in a quest to master all kinds of martial arts.  Machop's muscles are special\u2014they never get sore no matter how much they are used in exercise. This Pok\xe9mon has sufficient power to hurl a hundred adult humans.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/066.png",types:["fighting"],evolutions:[{level:28,method:"level_up",to:"Machoke",_id:"557a72d07276d341b41ee1fa"}]},{_id:"557a72b07276d341b41ede50",pkdx_id:67,national_id:67,name:"Machoke",__v:3,image_url:"http://pokeapi.co/media/img/67.png",description:"Machoke undertakes bodybuilding every day even as it helps people with tough, physically demanding labor. On its days off, this Pok\xe9mon heads to the fields and mountains to exercise and train.  Machoke's thoroughly toned muscles possess the hardness of steel. This Pok\xe9mon has so much strength, it can easily hold aloft a sumo wrestler on just one finger.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/067.png",types:["fighting"],evolutions:[{method:"trade",to:"Machamp",_id:"557a72b07276d341b41ede51"}]},{_id:"557a72b07276d341b41ede54",pkdx_id:68,national_id:68,name:"Machamp",__v:3,image_url:"http://pokeapi.co/media/img/68.png",description:"Machamp is known as the Pok\xe9mon that has mastered every kind of martial arts. If it grabs hold of the foe with its four arms, the battle is all but over. The hapless foe is thrown far over the horizon.  Machamp has the power to hurl anything aside. However, trying to do any work requiring care and dexterity causes its arms to get tangled. This Pok\xe9mon tends to leap into action before it thinks.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/068.png",types:["fighting"],evolutions:[]},{_id:"557a72d07276d341b41ee1f4",pkdx_id:69,national_id:69,name:"Bellsprout",__v:4,image_url:"http://pokeapi.co/media/img/69.png",description:"Bellsprout's thin and flexible body lets it bend and sway to avoid any attack, however strong it may be. From its mouth, this Pok\xe9mon spits a corrosive fluid that melts even iron.  Bellsprout's thin and flexible body lets it bend and sway to avoid any attack, however strong it may be. From its mouth, this Pok\xe9mon spits a corrosive fluid that melts even iron.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/069.png",types:["poison","grass"],evolutions:[{level:21,method:"level_up",to:"Weepinbell",_id:"557a72d07276d341b41ee1f5"}]},{_id:"557a72cf7276d341b41ee1d4",pkdx_id:70,national_id:70,name:"Weepinbell",__v:4,image_url:"http://pokeapi.co/media/img/70.png",description:"Weepinbell has a large hook on its rear end. At night, the Pok\xe9mon hooks on to a tree branch and goes to sleep. If it moves around in its sleep, it may wake up to find itself on the ground.  Weepinbell has a large hook on its rear end. At night, the Pok\xe9mon hooks on to a tree branch and goes to sleep. If it moves around in its sleep, it may wake up to find itself on the ground.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/070.png",types:["poison","grass"],evolutions:[{method:"stone",to:"Victreebel",_id:"557a72cf7276d341b41ee1d5"}]},{_id:"557a72af7276d341b41ede40",pkdx_id:71,national_id:71,name:"Victreebel",__v:5,image_url:"http://pokeapi.co/media/img/71.png",description:"Victreebel has a long vine that extends from its head. This vine is waved and flicked about as if it were an animal to attract prey. When an unsuspecting prey draws near, this Pok\xe9mon swallows it whole.  Victreebel has a long vine that extends from its head. This vine is waved and flicked about as if it were an animal to attract prey. When an unsuspecting prey draws near, this Pok\xe9mon swallows it whole.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/071.png",types:["poison","grass"],evolutions:[]},{_id:"557a72c07276d341b41ee007",pkdx_id:72,national_id:72,name:"Tentacool",__v:5,image_url:"http://pokeapi.co/media/img/72.png",description:"Tentacool absorbs sunlight and refracts it using water inside its body to convert it into beam energy. This Pok\xe9mon shoots beams from the small round organ above its eyes.  Tentacool's body is largely composed of water. If it is removed from the sea, it dries up like parchment. If this Pok\xe9mon happens to become dehydrated, put it back into the sea.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/072.png",types:["poison","water"],evolutions:[{level:30,method:"level_up",to:"Tentacruel",_id:"557a72c07276d341b41ee008"}]},{_id:"557a72d17276d341b41ee20e",pkdx_id:73,national_id:73,name:"Tentacruel",__v:4,image_url:"http://pokeapi.co/media/img/73.png",description:"Tentacruel has tentacles that can be freely elongated and shortened at will. It ensnares prey with its tentacles and weakens the prey by dosing it with a harsh toxin. It can catch up to 80 prey at the same time.  Tentacruel has large red orbs on its head. The orbs glow before lashing the vicinity with a harsh ultrasonic blast. This Pok\xe9mon's outburst creates rough waves around it.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/073.png",types:["poison","water"],evolutions:[]},{_id:"557a72d17276d341b41ee205",pkdx_id:74,national_id:74,name:"Geodude",__v:4,image_url:"http://pokeapi.co/media/img/74.png",description:"When Geodude sleeps deeply, it buries itself halfway into the ground. It will not awaken even if hikers step on it unwittingly. In the morning, this Pok\xe9mon rolls downhill in search of food.  The longer a Geodude lives, the more its edges are chipped and worn away, making it more rounded in appearance. However, this Pok\xe9mon's heart will remain hard, craggy, and rough always.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/074.png",types:["ground","rock"],evolutions:[{level:25,method:"level_up",to:"Graveler",_id:"557a72d17276d341b41ee206"}]},{_id:"557a72b17276d341b41ede6a",pkdx_id:75,national_id:75,name:"Graveler",__v:4,image_url:"http://pokeapi.co/media/img/75.png",description:"Rocks are Graveler's favorite food. This Pok\xe9mon will climb a mountain from the base to the summit, crunchingly feasting on rocks all the while. Upon reaching the peak, it rolls back down to the bottom.  Graveler grows by feeding on rocks. Apparently, it prefers to eat rocks that are covered in moss. This Pok\xe9mon eats its way through a ton of rocks on a daily basis.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/075.png",types:["ground","rock"],evolutions:[{method:"trade",to:"Golem",_id:"557a72b17276d341b41ede6b"}]},{_id:"557a72b17276d341b41ede73",pkdx_id:76,national_id:76,name:"Golem",__v:5,image_url:"http://pokeapi.co/media/img/76.png",description:"Golem is known for rolling down from mountains. To prevent them from rolling into the homes of people downhill, grooves have been dug into the sides of mountains to serve as guideways for diverting this Pok\xe9mon's course.  Golem live up on mountains. If there is a large earthquake, these Pok\xe9mon will come rolling down off the mountains en masse to the foothills below.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/076.png",types:["ground","rock"],evolutions:[]},{_id:"557a72d17276d341b41ee1fd",pkdx_id:77,national_id:77,name:"Ponyta",__v:3,image_url:"http://pokeapi.co/media/img/77.png",description:"Ponyta is very weak at birth. It can barely stand up. This Pok\xe9mon becomes stronger by stumbling and falling to keep up with its parent.  Ponyta is very weak at birth. It can barely stand up. This Pok\xe9mon becomes stronger by stumbling and falling to keep up with its parent.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/077.png",types:["fire"],evolutions:[{level:40,method:"level_up",to:"Rapidash",_id:"557a72d17276d341b41ee1fe"}]},{_id:"557a72cf7276d341b41ee1cc",pkdx_id:78,national_id:78,name:"Rapidash",__v:3,image_url:"http://pokeapi.co/media/img/78.png",description:"Rapidash usually can be seen casually cantering in the fields and plains. However, when this Pok\xe9mon turns serious, its fiery manes flare and blaze as it gallops its way up to 150 mph.  Rapidash usually can be seen casually cantering in the fields and plains. However, when this Pok\xe9mon turns serious, its fiery manes flare and blaze as it gallops its way up to 150 mph.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/078.png",types:["fire"],evolutions:[]},{_id:"557a72d07276d341b41ee1e2",pkdx_id:79,national_id:79,name:"Slowpoke",__v:4,image_url:"http://pokeapi.co/media/img/79.png",description:"Slowpoke uses its tail to catch prey by dipping it in water at the side of a river. However, this Pok\xe9mon often forgets what it's doing and often spends entire days just loafing at water's edge.  Slowpoke uses its tail to catch prey by dipping it in water at the side of a river. However, this Pok\xe9mon often forgets what it's doing and often spends entire days just loafing at water's edge.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/079.png",types:["water","psychic"],evolutions:[{method:"trade",to:"Slowking",_id:"557a72d07276d341b41ee1e4"},{level:37,method:"level_up",to:"Slowbro",_id:"557a72d07276d341b41ee1e3"}]},{_id:"557a72b17276d341b41ede66",pkdx_id:80,national_id:80,name:"Slowbro",__v:4,image_url:"http://pokeapi.co/media/img/80.png",description:"Slowbro's tail has a Shellder firmly attached with a bite. As a result, the tail can't be used for fishing anymore. This causes Slowbro to grudgingly swim and catch prey instead.  Slowbro's tail has a Shellder firmly attached with a bite. As a result, the tail can't be used for fishing anymore. This causes Slowbro to grudgingly swim and catch prey instead.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/080.png",types:["water","psychic"],evolutions:[]},{_id:"557a72b47276d341b41edebc",pkdx_id:81,national_id:81,name:"Magnemite",__v:4,image_url:"http://pokeapi.co/media/img/81.png",description:"Magnemite floats in the air by emitting electromagnetic waves from the units at its sides. These waves block gravity. This Pok\xe9mon becomes incapable of flight if its internal electrical supply is depleted.  Magnemite attaches itself to power lines to feed on electricity. If your house has a power outage, check your circuit breakers. You may find a large number of this Pok\xe9mon clinging to the breaker box.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/081.png",types:["steel","electric"],evolutions:[{level:30,method:"level_up",to:"Magneton",_id:"557a72b47276d341b41edebd"}]},{_id:"557a72b27276d341b41ede87",pkdx_id:82,national_id:82,name:"Magneton",__v:5,image_url:"http://pokeapi.co/media/img/82.png",description:"Magneton emits a powerful magnetic force that is fatal to electronics and precision instruments. Because of this, it is said that some towns warn people to keep this Pok\xe9mon inside a Pok\xe9 Ball.  Magneton emits a powerful magnetic force that is fatal to mechanical devices. As a result, large cities sound sirens to warn citizens of large-scale outbreaks of this Pok\xe9mon.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/082.png",types:["steel","electric"],evolutions:[{method:"other",to:"Magnezone",_id:"557a72b27276d341b41ede88"}]},{_id:"557a72d07276d341b41ee1ec",pkdx_id:83,national_id:83,name:"Farfetchd",__v:5,image_url:"http://pokeapi.co/media/img/83.png",description:"Farfetch'd is always seen with a stalk from a plant of some sort. Apparently, there are good stalks and bad stalks. This Pok\xe9mon has been known to fight with others over stalks.  Farfetch'd is always seen with a stalk from a plant of some sort. Apparently, there are good stalks and bad stalks. This Pok\xe9mon has been known to fight with others over stalks.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/083.png",types:["normal","flying"],evolutions:[]},{_id:"557a72cf7276d341b41ee1d9",pkdx_id:84,national_id:84,name:"Doduo",__v:4,image_url:"http://pokeapi.co/media/img/84.png",description:"Doduo's two heads contain completely identical brains. A scientific study reported that on rare occasions, there will be examples of this Pok\xe9mon possessing different sets of brains.  Doduo's two heads never sleep at the same time. Its two heads take turns sleeping, so one head can always keep watch for enemies while the other one sleeps.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/084.png",types:["normal","flying"],evolutions:[{level:31,method:"level_up",to:"Dodrio",_id:"557a72cf7276d341b41ee1da"}]},{_id:"557a72cf7276d341b41ee1c3",pkdx_id:85,national_id:85,name:"Dodrio",__v:4,image_url:"http://pokeapi.co/media/img/85.png",description:"Apparently, the heads aren't the only parts of the body that Dodrio has three of. It has three sets of hearts and lungs as well, so it is capable of running long distances without rest.  Watch out if Dodrio's three heads are looking in three separate directions. It's a sure sign that it is on its guard. Don't go near this Pok\xe9mon if it's being wary\u2014it may decide to peck you.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/085.png",types:["normal","flying"],evolutions:[]},{_id:"557a72b17276d341b41ede6f",pkdx_id:86,national_id:86,name:"Seel",__v:3,image_url:"http://pokeapi.co/media/img/86.png",description:"Seel hunts for prey in the frigid sea underneath sheets of ice. When it needs to breathe, it punches a hole through the ice with the sharply protruding section of its head.  Seel hunts for prey in the frigid sea underneath sheets of ice. When it needs to breathe, it punches a hole through the ice with the sharply protruding section of its head.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/086.png",types:["water"],evolutions:[{level:34,method:"level_up",to:"Dewgong",_id:"557a72b17276d341b41ede70"}]},{_id:"557a72b47276d341b41edecf",pkdx_id:87,national_id:87,name:"Dewgong",__v:4,image_url:"http://pokeapi.co/media/img/87.png",description:"Dewgong loves to snooze on bitterly cold ice. The sight of this Pok\xe9mon sleeping on a glacier was mistakenly thought to be a mermaid by a mariner long ago.  Dewgong loves to snooze on bitterly cold ice. The sight of this Pok\xe9mon sleeping on a glacier was mistakenly thought to be a mermaid by a mariner long ago.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/087.png",types:["water","ice"],evolutions:[]},{_id:"557a72b27276d341b41ede8c",pkdx_id:88,national_id:88,name:"Grimer",__v:3,image_url:"http://pokeapi.co/media/img/88.png",description:"Grimer emerged from the sludge that settled on a polluted seabed. This Pok\xe9mon loves anything filthy. It constantly leaks a horribly germ-infested fluid from all over its body.  Grimer's sludgy and rubbery body can be forced through any opening, however small it may be. This Pok\xe9mon enters sewer pipes to drink filthy wastewater.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/088.png",types:["poison"],evolutions:[{level:38,method:"level_up",to:"Muk",_id:"557a72b27276d341b41ede8d"}]},{_id:"557a72b27276d341b41ede90",pkdx_id:89,national_id:89,name:"Muk",__v:3,image_url:"http://pokeapi.co/media/img/89.png",description:"This Pok\xe9mon's favorite food is anything that is repugnantly filthy. In dirty towns where people think nothing of throwing away litter on the streets, Muk are certain to gather.  From Muk's body seeps a foul fluid that gives off a nose-bendingly horrible stench. Just one drop of this Pok\xe9mon's body fluid can turn a pool stagnant and rancid.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/089.png",types:["poison"],evolutions:[]},{_id:"557a72b17276d341b41ede62",pkdx_id:90,national_id:90,name:"Shellder",__v:3,image_url:"http://pokeapi.co/media/img/90.png",description:"At night, this Pok\xe9mon uses its broad tongue to burrow a hole in the seafloor sand and then sleep in it. While it is sleeping, Shellder closes its shell, but leaves its tongue hanging out.  At night, this Pok\xe9mon uses its broad tongue to burrow a hole in the seafloor sand and then sleep in it. While it is sleeping, Shellder closes its shell, but leaves its tongue hanging out.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/090.png",types:["water"],evolutions:[{method:"stone",to:"Cloyster",_id:"557a72b17276d341b41ede63"}]},{_id:"557a72b27276d341b41ede93",pkdx_id:91,national_id:91,name:"Cloyster",__v:4,image_url:"http://pokeapi.co/media/img/91.png",description:"Cloyster is capable of swimming in the sea. It does so by swallowing water, then jetting it out toward the rear. This Pok\xe9mon shoots spikes from its shell using the same system.  Cloyster is capable of swimming in the sea. It does so by swallowing water, then jetting it out toward the rear. This Pok\xe9mon shoots spikes from its shell using the same system.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/091.png",types:["water","ice"],evolutions:[]},{_id:"557a72b27276d341b41ede97",pkdx_id:92,national_id:92,name:"Gastly",__v:4,image_url:"http://pokeapi.co/media/img/92.png",description:"Gastly is largely composed of gaseous matter. When exposed to a strong wind, the gaseous body quickly dwindles away. Groups of this Pok\xe9mon cluster under the eaves of houses to escape the ravages of wind.  Gastly is largely composed of gaseous matter. When exposed to a strong wind, the gaseous body quickly dwindles away. Groups of this Pok\xe9mon cluster under the eaves of houses to escape the ravages of wind.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/092.png",types:["poison","ghost"],evolutions:[{level:25,method:"level_up",to:"Haunter",_id:"557a72b27276d341b41ede98"}]},{_id:"557a72b37276d341b41edeb0",pkdx_id:93,national_id:93,name:"Haunter",__v:5,image_url:"http://pokeapi.co/media/img/93.png",description:"Haunter is a dangerous Pok\xe9mon. If one beckons you while floating in darkness, you must never approach it. This Pok\xe9mon will try to lick you with its tongue and steal your life away.  Haunter is a dangerous Pok\xe9mon. If one beckons you while floating in darkness, you must never approach it. This Pok\xe9mon will try to lick you with its tongue and steal your life away.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/093.png",types:["poison","ghost"],evolutions:[{method:"trade",to:"Gengar",_id:"557a72b37276d341b41edeb1"}]},{_id:"557a72b47276d341b41edeca",pkdx_id:94,national_id:94,name:"Gengar",__v:5,image_url:"http://pokeapi.co/media/img/94.png",description:"Sometimes, on a dark night, your shadow thrown by a streetlight will suddenly and startlingly overtake you. It is actually a Gengar running past you, pretending to be your shadow.  Sometimes, on a dark night, your shadow thrown by a streetlight will suddenly and startlingly overtake you. It is actually a Gengar running past you, pretending to be your shadow.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/094.png",types:["poison","ghost"],evolutions:[{method:"other",to:"Gengar-mega",_id:"557a72b47276d341b41edecb"}]},{_id:"557a72b47276d341b41edec5",pkdx_id:95,national_id:95,name:"Onix",__v:4,image_url:"http://pokeapi.co/media/img/95.png",description:"Onix has a magnet in its brain. It acts as a compass so that this Pok\xe9mon does not lose direction while it is tunneling. As it grows older, its body becomes increasingly rounder and smoother.  Onix has a magnet in its brain. It acts as a compass so that this Pok\xe9mon does not lose direction while it is tunneling. As it grows older, its body becomes increasingly rounder and smoother.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/095.png",types:["ground","rock"],evolutions:[{method:"trade",to:"Steelix",_id:"557a72b47276d341b41edec6"}]},{_id:"557a72b27276d341b41ede9c",pkdx_id:96,national_id:96,name:"Drowzee",__v:3,image_url:"http://pokeapi.co/media/img/96.png",description:"If your nose becomes itchy while you are sleeping, it's a sure sign that one of these Pok\xe9mon is standing above your pillow and trying to eat your dream through your nostrils.  If your nose becomes itchy while you are sleeping, it's a sure sign that one of these Pok\xe9mon is standing above your pillow and trying to eat your dream through your nostrils.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/096.png",types:["psychic"],evolutions:[{level:26,method:"level_up",to:"Hypno",_id:"557a72b27276d341b41ede9d"}]},{_id:"557a72b87276d341b41edf45",pkdx_id:97,national_id:97,name:"Hypno",__v:3,image_url:"http://pokeapi.co/media/img/97.png",description:"Hypno holds a pendulum in its hand. The arcing movement and glitter of the pendulum lull the foe into a deep state of hypnosis. While this Pok\xe9mon searches for prey, it polishes the pendulum.  Hypno holds a pendulum in its hand. The arcing movement and glitter of the pendulum lull the foe into a deep state of hypnosis. While this Pok\xe9mon searches for prey, it polishes the pendulum.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/097.png",types:["psychic"],evolutions:[]},{_id:"557a72b27276d341b41ede7e",pkdx_id:98,national_id:98,name:"Krabby",__v:3,image_url:"http://pokeapi.co/media/img/98.png",description:"Krabby live on beaches, burrowed inside holes dug into the sand. On sandy beaches with little in the way of food, these Pok\xe9mon can be seen squabbling with each other over territory.  Krabby live on beaches, burrowed inside holes dug into the sand. On sandy beaches with little in the way of food, these Pok\xe9mon can be seen squabbling with each other over territory.",art_url:"http://assets22.pokemon.com/assets/cms2/img/pokedex/full/098.png",types:["water"],evolutions:[{level:28,method:"level_up",to:"Kingler",_id:"557a72b27276d341b41ede7f"}]},{_id:"557a72b37276d341b41edea4",pkdx_id:99,national_id:99,name:"Kingler",__v:3,image_url:"http://pokeapi.co/media/img/99.png",description:"Kingler has an enormous, oversized claw. It waves this huge claw in the air to communicate with others. However, because the claw is so heavy, the Pok\xe9mon quickly tires.  Kingler has an enormous, oversized claw. It waves this 